window.bookSummaryJSON = "<p>Don't make important life decisions while drunk....</p> <p>Dakota's whole life changes when she swipes yes to a dragon shifter on MatchMater, the world's only dating app for paranormals. Waking up the next morning, she finds herself only able to think about one thing...he's her mate.</p> <p>Achilles isn't interested in being a mate, and when his latest one-night stand turns out to be more, he doesn't want to accept it.</p> <p><i>Reluctant Dragon Mate</i> is book one of the MatchMater Paranormal Dating App Series. It contains a stand-alone shifter romance.</p>"; 
